import React from 'react';
import '../App.css';
import "./Services.css";
import { Button } from '../components/Button.js';

const Services = () => {
  return (
    <div className="services">
      <div className="need">
        <a href="/needcompanion">
        <Button className='need-companion' buttonStyle='btn--outline' buttonSize='btn--large'>NEED COMPANION</Button>
        </a>
      </div>
      <div className="be">
      <a href="/bookcompanion">
        <Button className='be-companion' buttonStyle='btn--outline' buttonSize='btn--large'>BE A COMPANION</Button>
        </a>
      </div>
      </div>
  );
};

export default Services;
